import React, { Component } from "react";
import classes from "./ListBuilder.module.css";
import Logo from "../Logo/Logo";
import ValorImage from "../../assets/images/Team_Valor.png";

class ListBuilder extends Component {
  test = group => {
    console.log("group is", group);
    this.props.test(group);
  };

  render() {
    console.log("the string is", this.props.text);

    console.log("the props are", this.props);
    let list = null;
    let group = this.props.team + "\n";

    //   props.text += props.Team;

    if (this.props.list.length !== 0) {
      list = this.props.list.map(element => {
        if (
          element[6].trim() ===
          "My friend will play for me (enter their name in the comment)"
        ) {
          group +=
            element[0].trim() +
            ", " +
            element[1].trim() +
            ", " +
            element[3].trim() +
            ", " +
            "via proxy";
          return (
            <li>
              {element[0].trim() +
                ", " +
                element[1].trim() +
                ", " +
                element[3].trim() +
                ", " +
                "via proxy"}
            </li>
          );
        } else if (
          element[6].trim() ===
          "I need someone to play for me (add your telegram name in the comments so an admin can contact you)"
        ) {
          group +=
            element[0].trim() +
            ", " +
            element[1].trim() +
            ", " +
            element[3].trim() +
            ", " +
            "needs proxy";
          return (
            <li>
              {element[0].trim() +
                ", " +
                element[1].trim() +
                ", " +
                element[3].trim() +
                ", " +
                "needs proxy"}
            </li>
          );
        } else {
          group +=
            element[0].trim() +
            ", " +
            element[1].trim() +
            ", " +
            element[3].trim();
          return (
            <li>
              {element[0].trim() +
                ", " +
                element[1].trim() +
                ", " +
                element[3].trim()}
            </li>
          );
        }
      });
    } else {
      return (
        <div className={[classes.List, "container"].join(" ")}>
          <ul>
            <li>No {this.props.team}</li>
          </ul>
        </div>
      );
    }

    console.log("group is ", group);

    console.log("calling test now");
    test(list);

    return (
      <div className={[classes.List, "container"].join(" ")}>
        <Logo src={ValorImage} type="team" />
        <ul>{list} </ul>
      </div>
    );
  }
}
export default ListBuilder;
